window.bookSummaryJSON = "<p><b>Fall in love with the epic tale of Ava and Hercules in the third installment of the Romancing the Seas series!</b><br> <br> Ava, the oldest daughter of Isis and Poseidon, yearns for love above all else. But when she's betrothed to the formidable and brooding hero, Hercules, she begins to question her fate.</p> <p>Sent as a gift from Isis, Ava is tasked with marrying Hercules and convincing him to help our heroes on a treacherous journey to collect a valuable treasure. Only then will Isis agree to negotiate and order her sirens to stop attacking men. But with each treasure guarded by a magical monster, success will require the combined skills and bravery of our heroes, along with the help of Captain Stone, Georgette, Serena, and Prince Edward.</p> <p>As they set out on their adventure, Hercules is dark and uncompromising, but Ava discovers a beautiful soul beneath his tough exterior, tortured by his past. Will Ava be able to bring Hercules out of his shell and find true love with him? And what will happen if they succeed on their mission? Find out in the heart-pumping and romantic third book of the Romancing the Seas series. <b>Don't wait, start reading now!<br> <br> This steamy fantasy romance series is best enjoyed when listened to in order. With graphic violence, nudity, spicy romance and intense scenes, this book is written for mature audiences only.</b></p>"; 
